import axios from 'axios';

const WALLET_API_BASE_URL = "http://localhost:8080/wallet/";

class WalletService {

    // const signUp=(user)=>{
    //     return axios.post(WALLET_API_BASE_URL + '/create').then((response)=>response.json())
    // }
    //GET
    getWallets(){
        return axios.get(WALLET_API_BASE_URL+'/getAll');
    }

    getWallet(loginVO){
        return axios.get(WALLET_API_BASE_URL+'/get', loginVO);
    }

    checkBalance(loginVO){
        return axios.get(WALLET_API_BASE_URL+'/balance', loginVO);
    }

    checkHistory(loginVO){
        return axios.get(WALLET_API_BASE_URL+'/history', loginVO);
    }

    //POST
    createWallet(wallet){
        return axios.post(WALLET_API_BASE_URL + '/create', wallet);
    }

    //PUT
    addAmount(loginVO, amount){
        return axios.put(WALLET_API_BASE_URL + '/add/' + amount, loginVO);
    }

    withdrawAmount(loginVO, amount){
        return axios.put(WALLET_API_BASE_URL + '/withdraw/' + amount, loginVO);
    }

    //DELETE
    deleteEmployee(loginVO){
        return axios.delete(WALLET_API_BASE_URL + '/' + loginVO);
    }
}

export default new WalletService()
